import React from 'react';
import TodoProvider from './contexts/TodoContext';
import AddTodo from './components/AddTodo';
import TodoList from './components/TodoList';

function App() {

  return (
   <TodoProvider>
     <TodoList></TodoList>
    <AddTodo></AddTodo>
   </TodoProvider>
  );
}

export default App;
